import React from 'react';

class Highlight extends React.Component {
  render() {
    return (
        <span class={"highlight-" + this.props.color}>
            {this.props.children}
        </span> 
      );
    }
}

export default Element;

const Red = ({ children }) => {
    <Highlight color="salmon"></Highlight>
};

const Blue = ({ children }) => {
    <Highlight color="lightblue"></Highlight>
};

const Green = ({ children }) => {
    <Highlight color="green"></Highlight>
};

const Yellow = ({ children }) => {
    <Highlight color="highlight"></Highlight>
}

const White = ({ children }) => {
    <Highlight color="white"></Highlight>
}


export { Red, Blue, Green, Yellow, White };
